import React from 'react'
import { Icon } from 'semantic-ui-react'

const IconGroup = () => (
  <Icon.Group size='small'>
    <Icon size='small' name='circle outline' />
    <Icon name='phone volume' />
  </Icon.Group>
)

export default IconGroup;
